description:
30プリウス 前期/後期 専用<br>
シートカバーとフロアマットとグリップカバーの３点セット！！！<br><br>

ツートンカラーがオシャレです！！<br><br>


※必ず下記の適合をご覧の上、お選び下さい。<br><br>

【適合】<br><br>

・前期Aタイプ<br>
年式：H21/05～H23/11<br>
乗車定員：5人<br>
型式：ZVW30 <br>
参考グレード：G /G“ツーリングセレクション”/ S / S“ツーリングセレクション” <br>
形状確認：1列目：運転席手動シート・シートリフターあり ※フロントセンターコンソールカバー付 <br>
本革シート車は適合不可<br><br>

・前期Bタイプ<br>
年式：H21/05～H23/11<br>
乗車定員:5人<br>
型式:ZVW30<br>
参考グレード:L<br>
形状確認:1列目：運転席シートリフターなし　※フロントセンターコンソールカバー付 <br><br>

・後期Cタイプ<br>
年式:H23/12～H27/12<br> 
乗車定員:5人<br>
型式:ZVW30 <br>
参考グレード:S / S“ツーリングセレクション”<br> 
形状確認:1列目：運転席手動シート・シートリフターあり ※フロントセンターコンソールカバー付 <br><br>

・後期Dタイプ<br>
年式:H23/12～H27/12 <br> 
乗車定員:5 人<br> 
型式:ZVW30 <br>
参考グレード:G / G“ツーリングセレクション”<br> 
形状確認:1列目：運転席パワーシート　※フロントセンターコンソールカバー付 <br>
本革シート車適合不可<br><br><br><br>


【ご注意】<br>
こちらの商品は納期が１ヶ月～１ヶ月半かかります。お急ぎの方は事前にお問い合わせ下さい。<br>
受注生産のため、代引きは不可となります。<br>
送料無料ですが、沖縄・北海道・離島の方は別途送料見積となりますので、事前にお問い合わせ下さい。<br>







